import React from "react";
import { CiForkAndKnife } from "react-icons/ci";

const FilterProduct = ({ category, onClick, isActive }) => {
  return (
    <div onClick={onClick}>
      <div className={`text-3xl p-5  rounded-full cursor-pointer ${isActive ? "bg-red-600 text-white" : "bg-yellow-500"}`}>
        <img src="https://in.images.search.yahoo.com/search/images;_ylt=Awrx.aszw2RkS4sPjuC7HAx.;_ylu=Y29sbwNzZzMEcG9zAzEEdnRpZAMEc2VjA3Nj?p=burger+png+images&type=E210IN826G0&ei=UTF-8&fr=mcafee&th=118.9&tw=132.3&imgurl=https%3A%2F%2Fpurepng.com%2Fpublic%2Fuploads%2Fmedium%2Fpurepng.com-fast-food-burgerburgerfast-foodhammeatfast-food-burgermc-donaldsburger-king-231519340201mh7zr.png&rurl=https%3A%2F%2Fpurepng.com%2Fphoto%2F1051%2Ffast-food-burger&size=799KB&name=Fast+Food+Burger+PNG+Image+-+PurePNG+%7C+Free+transparent+CC0+PNG+Image+...&oid=20&h=809&w=900&turl=https%3A%2F%2Ftse1.mm.bing.net%2Fth%3Fid%3DOIP.Ypd5jdeNnM7fOSigxNj-uAHaGq%26pid%3DApi%26rs%3D1%26c%3D1%26qlt%3D95%26w%3D132%26h%3D118&tt=Fast+Food+Burger+PNG+Image+-+PurePNG+%7C+Free+transparent+CC0+PNG+Image+...&sigr=3VSDeq0XPJi4&sigit=hcs4JNQlJKrH&sigi=Z_0g.eFdysyt&sign=jghszpP0HFPD&sigt=jghszpP0HFPD" alt="" />
      </div>
      <p className="text-center font-medium my-1 capitalize">{category}</p>
    </div>
  );
};

export default FilterProduct;
